webpackJsonp([79],{1377:function(e,n){e.exports={headerTitle:"观察导管筛管",experimentStep:[{name:"实验步骤\r",classes:[],detail:[{text:"点击装片盒选择装片放到显微镜下观察，调节各部件使视野明亮、物像清晰，亦可点击“自动调至最佳”按钮观察，点击目镜或视野框可全屏观察。",classes:[]}]}],purpose:{icon:"images/btn-shiyanmudi.png",name:"目的要求&nbsp;:",menu:[{text:"筛管的分布部位，辨认导管、筛管的结构特征。\r"},{text:""}]},conclusion:{icon:"images/btn-taolundian.png",name:"讨论&nbsp;:",menu:[{question:"怎样区分导管和筛管?\r",expend:!1,answer:"导管是一种死亡了的、只有细胞壁的细胞，而且上下两个细胞是贯通的，位于维管束的木质部。它的功能很简单，就是把从根部吸收的水和无机盐输送到植株身体各处。\r<br/>筛管位于维管束的韧皮部，也是纵向排列的细胞，不过组成它的细胞是活的。每个细胞还有一个伴胞，上下两个细胞的细胞壁没有贯通，但它们之间的细胞壁特化了，适合有机物的运输。筛管就是把合成的有机物运输到各处的。植物体韧皮部内运输有机养料的管道，是由许多筒状细胞上下连接而成。<br/>"},{}]},equipment:{menu:[{imgSrc:"assets/898dc2c947cee718/nkNcOC4z.png",name:"显微镜"},{imgSrc:"assets/898dc2c947cee718/zF8OB4-FRzguMA==.png",name:"南瓜茎纵切装片"}],icon:"images/btn-shiyanqicai.png",name:"材料用具&nbsp;:"}}},785:function(e,n,s){"use strict";Object.defineProperty(n,"__esModule",{value:!0}),n.default=extendsClass(nbBio.BiologyMain,{frame0:nb.BaseFrame.create(function(e){e.stepFunc0=function(e){e.on("stepSet",function(){nb.commonFunc.initMicroscope(e,[{texture:"slide3",name:"南瓜茎纵切",nbsID:"0145/model_slide1",slID:"sl0025",slTexture:"sl.png",newSlide:!0}])})}}),start:function(){this.autoBindScript()},menu:Object.assign(s(1377))})}});